import logo from './movies.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* "Team Movies" moved to the top */}
        <p className="App-title">Team Movies</p>

        {/* Logo remains centered */}
        <img src={logo} className="App-logo" alt="logo" />

        <a
          className="App-link"
          href="https://i.ytimg.com/vi/DQnVWG7jUXs/hq720.jpg?sqp=-oaymwEhCK4FEIIDSFryq4qpAxMIARUAAAAAGAElAADIQj0AgKJD&rs=AOn4CLDbpU93VAQC7cJ9y9dA_1kefF9VOQ"
          target="_blank"
          rel="noopener noreferrer"
        >
          Currently Under Construction
        </a>
      </header>
    </div>
  );
}

export default App;
